def main():
    import sys
    input = sys.stdin.read
    data = input().split()

    idx = 0
    M, N, T = int(data[idx]), int(data[idx+1]), int(data[idx+2])
    idx += 3

    elevations = []
    for i in range(M):
        row = []
        for j in range(N):
            row.append(int(data[idx]))
            idx += 1
        elevations.append(row)

    is_starting_point = []
    for i in range(M):
        row = []
        for j in range(N):
            row.append(int(data[idx]))
            idx += 1
        is_starting_point.append(row)

    def bfs(difficulty, start_r, start_c):
        from collections import deque
        queue = deque([(start_r, start_c)])
        visited = [[False]*N for _ in range(M)]
        visited[start_r][start_c] = True
        count = 1

        directions = [(-1,0), (1,0), (0,-1), (0,1)]

        while queue:
            r, c = queue.popleft()
            for dr, dc in directions:
                nr, nc = r + dr, c + dc
                if 0 <= nr < M and 0 <= nc < N and not visited[nr][nc]:
                    if abs(elevations[nr][nc] - elevations[r][c]) <= difficulty:
                        visited[nr][nc] = True
                        queue.append((nr, nc))
                        count += 1
                        if count >= T:
                            return True
        return False

    total_difficulty = 0
    for i in range(M):
        for j in range(N):
            if is_starting_point[i][j]:
                # Binary search on difficulty
                left, right = 0, 10**9
                result = -1
                while left <= right:
                    mid = (left + right) // 2
                    if bfs(mid, i, j):
                        result = mid
                        right = mid - 1
                    else:
                        left = mid + 1
                total_difficulty += result

    print(total_difficulty)

if __name__ == "__main__":
    main()
